import {changeTodoCompleted, fetchTodo, changeTodoDescriptionUpdate, changeTodoResponsibleUpdate, changeTodoPriorityUpdate} from '../actions/editTodo.actions';

const editTodoContainer = {
    mapStateToProps: state => ({
        todoPriorityUpdate: state.editTodo.todoPriorityUpdate,
        todoDescriptionUpdate: state.editTodo.todoDescriptionUpdate,
        todoResponsibleUpdate: state.editTodo.todoResponsibleUpdate,
        todoCompletedUpdate: state.editTodo.todoCompletedUpdate,
    }),
    mapDispatchToProps: dispatch => ({
            changeTodoDescriptionUpdate: (event) => dispatch(changeTodoDescriptionUpdate(event)),
            changeTodoResponsibleUpdate: (event) => dispatch(changeTodoResponsibleUpdate(event)),
            changeTodoPriorityUpdate: (event) => dispatch(changeTodoPriorityUpdate(event)),
            changeTodoCompleted: (event) => dispatch(changeTodoCompleted(event)),
            fetchTodo: (id) => dispatch(fetchTodo(id)),
            update: () => dispatch({type: 'update'}),
    })
}

export default editTodoContainer;
